import React from "react";

export default function ProductExtended({ product }) {
  return (
    <div className="product">
      <div className="product-img">
        <img src={product.image} alt={product.name} />
      </div>
      <h1>{product.name}</h1>
      <p> {product.description}</p>
    </div>
  );
}
